class MovingAverage {
public:
    /** Initialize your data structure here. */
    MovingAverage(int size)
        : capacity(size), size(0), sum(0)
    { }

    double next(int val) {
        sum += val;
        q.emplace_back(val);
        ++size;

        if (size > capacity) {
            sum -= q.front();
            q.pop_front();
            --size;
        }

        return static_cast(sum) / size;
    }

private:
    int capacity, size, sum;
    deque q;
};

