                q.push({freq[i], 'a' + i});
            }
        }

        string ans;

        while (!q.empty()) {
            auto a = q.top();
            q.pop();

            if (q.empty()) {
                if (a.first > 1) {
                    return "";
                } else {
                    ans.push_back(a.second);
                    break;
                }
            }

            auto b = q.top();
            q.pop();

            ans.push_back(a.second);
            ans.push_back(b.second);

            if (a.first > 1) {
                q.push({a.first - 1, a.second});
            }
            if (b.first > 1) {
                q.push({b.first - 1, b.second});
            }
        }

        return ans;
