class DisjointSet {
public:
    DisjointSet(int n)
        : count(0) {
    }

    void add(int x) {
        parent[x] = x;
        ++count;
    }

    int find(int x) {

        if (x == parent[x]) {
            return x;
        }

        return parent[x] = find(parent[x]);
    }

    void merge(int x, int y) {

        int px = find(x);
        int py = find(y);

        if (px == py) {
            return;
        }

        --count;
        parent[px] = py;
    }

    int query() {
        return count;
    }

private:
    int count;
    unordered_map parent;
};


