         *  buy_1st : The maximum profits that we can get after conducting
         *            the first purchase.
         *
         *  sell_1st: The maximum profits that we can get after conducting
         *            the first selling.
         *
         *  buy_2nd : The maximum profits that we can get after conducting
         *            the second purchase.
