class Solution {
public:
    vector inorderTraversal(TreeNode* root) {

        /**
         *  TC: O(N), where
         *      N is the number of nodes
         *
         *  SC: O(N)
         */

        vector ans;

        stack stk;
        while (root) {
            stk.emplace(root);
            root = root->left;
        }

        while (!stk.empty()) {
            auto node = stk.top();
            stk.pop();

            ans.emplace_back(node->val);

            node = node->right;
