        int elem;

        auto& vec_bgn = rover->first;
        auto& vec_end = rover->second;

        elem = *vec_bgn++;
        if (vec_bgn == vec_end) {
            rover = slots.erase(rover);
            --k;
        } else {
            ++rover;
        }

        if (rover == end) {
            rover = slots.begin();
        }

        return elem;
    }

    bool hasNext() {
        return k > 0;
    }

