class Solution {
public:
    int depthSum(vector& list) {

        /**
         *  TC: O(N), where
         *      N is the number of objects
         *
         *  SC: O(N)
         */

        int ans = 0;

        stack> stk;
        int n = list.size();
        for (int i = n - 1 ; i >= 0 ; --i) {
            stk.push({list[i], 1});
        }

        while (!stk.empty()) {
            auto rec = stk.top();
            stk.pop();

            auto& item = rec.first;
            int depth = rec.second;

            if (item.isInteger()) {
                ans += item.getInteger() * depth;
            } else {
                auto& nested = item.getList();
                n = nested.size();
                for (int i = n - 1 ; i >= 0 ; --i) {
                    stk.push({nested[i], depth + 1});
                }
            }
        }

        return ans;
    }
