class Vector2D {
public:
    Vector2D(vector>& vec) {

        row = vec.begin();
        row_end = vec.end();

        if (row != row_end) {
            col = row->begin();
            findNext();
        }
    }

    int next() {
        int elem = cache;
        findNext();
        return elem;
    }

