        if (row == row_end) {
            return;
        }

        if (col != row->end()) {
            cache = *col++;
            return;
        }

        ++row;
        while (row != row_end) {
            if (!row->empty()) {
                col = row->begin();
                cache = *col++;
                break;
            }

            ++row;
        }
    }
};

