        if (!root) {
            return true;
        }

        if (lo && root->val val) {
            return false;
        }
        if (hi && root->val >= hi->val) {
            return false;
        }

        if (!runPreOrder(root->left, lo, root)) {
            return false;
        }
        return runPreOrder(root->right, root, hi);
