        if (!root) {
            return {nullptr, -1};
        }

        auto l = runPostOrder(root->left);
        auto r = runPostOrder(root->right);

        if (l.second == r.second) {
            return {root, l.second + 1};
        }

        if (l.second > r.second) {
            return {l.first, l.second + 1};
        }
        return {r.first, r.second + 1};
