                    if (node->left) {
                        next.emplace(node->left);
                    }
                    if (node->right) {
                        next.emplace(node->right);
                    }
                } else {
                    if (node->right) {
                        next.emplace(node->right);
                    }
                    if (node->left) {
                        next.emplace(node->left);
                    }
