         *   / \   / \                    L     T     R
         *  4   5 6   7     InOrder  : 4, 2, 5, 1, 6, 3, 7
         *                             -------     -------
         */

        unordered_map map;
        int n = inorder.size();
        for (int i = 0 ; i & inorder, const vector& postorder,
            pair in_index, pair post_index,
            unordered_map& map) {

        int in_bgn = in_index.first, in_end = in_index.second;
        if (in_bgn > in_end) {
            return nullptr;
        }
        if (in_bgn == in_end) {
