        if (!root) {
            return Result();
        }

        auto l = runPostOrder(root->left, opt);
        auto r = runPostOrder(root->right, opt);

        int sum = root->val + l.sum + r.sum;
        if (sum > opt.sum) {
            opt.sum = sum;
            opt.root = root;
        }

        return Result(sum, root);
    }
