        if (!root) {
            return Record();
        }

        auto l = runPostOrder(root->left, ans);
        auto r = runPostOrder(root->right, ans);

        Record record;
        record.size = 1 + l.size + r.size;
        record.sum = root->val + l.sum + r.sum;

        double avg = static_cast(record.sum) / record.size;
        ans = max(avg, ans);

        return record;
    }
