 * struct TreeNode {
 *     int val;
 *     TreeNode *left;
 *     TreeNode *right;
 *     TreeNode(int x) : val(x), left(NULL), right(NULL) {}
 * };
 */
class Solution {
public:
    vector distanceK(TreeNode* root, TreeNode* target, int K) {

        /**
         *  TC: O(N),
         *      where N is the number of nodes
         *
         *  SC: O(N)
         */

        unordered_map> graph;
        buildGraph(root, graph);

        vector ans;
        findNodes(target, nullptr, graph, K, ans);
        return ans;
    }

private:
    void buildGraph(
        TreeNode* root, unordered_map>& graph) {

        queue q;
        q.emplace(root);

        while (!q.empty()) {
            auto node = q.front();
            q.pop();

            if (node->left) {
                graph[node->left].emplace(node);
                graph[node].emplace(node->left);
                q.emplace(node->left);
            }
            if (node->right) {
                graph[node->right].emplace(node);
                graph[node].emplace(node->right);
                q.emplace(node->right);
            }
        }
    }

    void findNodes(
        TreeNode* curr, TreeNode* pred,
        unordered_map>& graph,
        int k, vector& ans) {

        if (k == 0) {
            ans.emplace_back(curr->val);
        }

        for (auto neighbor : graph[curr]) {
            if (neighbor != pred) {
                findNodes(neighbor, curr, graph, k - 1, ans);
            }
        }
    }
};

