class Solution {
public:
    int oddEvenJumps(vector& A) {

        int n = A.size();

        vector odds(n, false);
        vector evens(n, false);
        odds[n - 1] = true;
        evens[n - 1] = true;

        map map;
        map[A[n - 1]] = n - 1;
        int ans = 1;

        for (int i = n - 2 ; i >= 0 ; --i) {
            int num = A[i];

            // Plan to apply a up jump from this position.
            auto it = map.lower_bound(num);
            if (it != map.end()) {
                odds[i] = evens[it->second];
            }

            // Plan to apply a down jump from this position.
            it = map.upper_bound(num);
            if (it != map.begin()) {
                evens[i] = odds[(--it)->second];
            }

            if (odds[i]) {
                ++ans;
            }
            map[num] = i;
        }

        return ans;
    }
};

