class Solution {
public:
    /**
     * @param n: An integer
     * @return: true if this is a happy number or false
     */
    bool isHappy(int n) {
        // write your code here

        std::unordered_set set;
        while (n != 1) {
            n = decompose(n);
            if (set.count(n) == 1) {
                return false;
            }
            set.insert(n);
        }

        return true;
    }

