        while (curr) {
            auto succ = curr->next;
            curr->next = pred;
            pred = curr;
            curr = succ;
            ++count;
        }

        auto left = head, right = pred;
        bool is_palin = true;
        for (int i = 0 ; i val != right->val) {
                is_palin = false;
                break;
            }
            left = left->next;
            right = right->next;
        }

        // Restore the right portion.
        curr = pred;
        pred = nullptr;
        for (int i = 0 ; i next;
            curr->next = pred;
            pred = curr;
            curr = succ;
