            if ((pred->val val) ||
                (pred->val > succ->val && val val) ||
                (pred->val > succ->val && pred->val next = node;
                node->next = succ;
                return head;
            }

            pred = succ;
            succ = succ->next;
        } while (pred != head);

        auto node = new Node(val);
        node->next = head->next;
        head->next = node;
        return head;
