class Solution {
public:
    Node* cloneGraph(Node* node) {

        /**
         *  TC: O(N), where
         *      N is the number of nodes
         *
         *  SC: O(N)
         */

        if (!node) {
            return nullptr;
        }

        unordered_map map;
        map[node] = new Node(node->val);

        queue q;
        q.emplace(node);

        unordered_set set;
        set.emplace(node);

        while (!q.empty()) {
            auto src = q.front();
            q.pop();

            for (auto dst : src->neighbors) {
                if (set.count(dst) == 0) {
                    map[dst] = new Node(dst->val);
                    q.emplace(dst);
                    set.emplace(dst);
                }
                map[src]->neighbors.emplace_back(map[dst]);
            }
        }

        return map[node];
    }
};

