Problem
LintCode 184. Largest Number
https://www.lintcode.com/problem/largest-number/description
Solution
class Solution {
public:
    /**
     * @param nums: A list of non negative integers
     * @return: A string
     */
    string largestNumber(vector &nums) {
        // write your code here

        /**
         * A: 65, B: 6
         *
         * A + B = 656
         * B + A = 665
         *
         * B + A > A + B => B > A
         */

        std::unordered_map radixes;
        for (int num : nums) {
            if (radixes.count(num) == 1) {
                continue;
            }
            int radix = (num > 0) ?
                static_cast(std::floor(std::log10(num))) + 1 : 1;
            radixes[num] = radix;
        }

        std::sort(nums.begin(), nums.end(),
            [&] (const auto& a, const auto& b) {
                long ab = a * static_cast(std::pow(10, radixes[b])) + b;
                long ba = b * static_cast(std::pow(10, radixes[a])) + a;
                return ab > ba;
            }
        );

        std::string ans;
        for (int num : nums) {
            ans += std::to_string(num);
        }

        // For the case that the string content is 000...
        if (ans[0] == '0') {
            return "0";
        }

        return ans;
    }
};

Simulation Puzzle/Strobogrammatic Number.body:
Problem
LintCode 644. Strobogrammatic Number
https://www.lintcode.com/problem/strobogrammatic-number/description
Solution
class Solution {
public:
    /**
     * @param num: a string
     * @return: true if a number is strobogrammatic or false
     */
    bool isStrobogrammatic(string &num) {
        // write your code here

        std::string mirror;
        for (char ch : num) {
            switch (ch) {
                case '6':
                    mirror.push_back('9');
                    break;
                case '9':
                    mirror.push_back('6');
                    break;
                case '0':
                case '1':
                case '8':
                    mirror.push_back(ch);
                    break;
                default:
                // Simply return false for the numbers including 2, 3, 4, 5, and 7.
                    return false;
            }
        }

        std::reverse(mirror.begin(), mirror.end());
        return mirror == num;
    }
};

